INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 7, 10.85, 24, 100, "エリコ", 10142, 1, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 100, "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 2, 11.15, 24, 101, "エリコ", 10142, 1, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 101, "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 5, 6.4, 24, 102, "エリコ", 10142, 7, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 102, "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 3, 0.0, 24, 103, "エリコ", 10142, 3, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 103, "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 8, 2.43, 24, 104, "エリコ", 10142, 2, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 104, "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 3, 9.08, 24, 105, "エリコ", 10142, 4, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 105, "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 6, 0.0, 24, 106, "エリコ", 10142, 6, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 106, "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 8, 10.6, 24, 107, "エリコ", 10142, 3, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 107, "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 4, 7.54, 24, 108, "エリコ", 10142, 6, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 108, "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 7, 11.5, 24, 109, "エリコ", 10142, 2, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 109, "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 8.83, 24, 110, "エリコ", 10142, 2, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 110, "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 2, 6.68, 24, 111, "エリコ", 10142, 1, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 111, "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 2, 8.8, 24, 112, "エリコ", 10142, 6, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 112, "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 8.9, 24, 113, "エリコ", 10142, 2, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 113, "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 5, 3.7, 24, 114, "エリコ", 10142, 2, 129901, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 114, "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 2, 7.6, 24, 200, "マコト", 10142, 1, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 200, "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 2.25, 24, 201, "マコト", 10142, 2, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 201, "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 3.28, 24, 202, "マコト", 10142, 2, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 202, "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 2.98, 24, 203, "マコト", 10142, 4, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 203, "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 3.0, 24, 204, "マコト", 10142, 4, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 204, "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 2, 10.3, 24, 205, "マコト", 10142, 1, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 205, "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 2.93, 24, 206, "マコト", 10142, 6, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 206, "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 9.3, 24, 207, "マコト", 10142, 3, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 207, "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 6.9, 24, 208, "マコト", 10142, 4, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 208, "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 2, 0.0, 24, 209, "マコト", 10142, 2, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 209, "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 2, 5.95, 24, 210, "マコト", 10142, 1, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 210, "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 6.73, 24, 211, "マコト", 10142, 2, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 211, "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 2, 0.0, 24, 212, "マコト", 10142, 2, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 212, "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 2, 6.65, 24, 213, "マコト", 10142, 1, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 213, "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 1, 3.05, 24, 214, "マコト", 10142, 6, 129801, "2024/03/31 12:00:00", "2030/12/17 14:59:59", 0.0, 214, "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！");
